  render () {
      const {listings} = this.props
      let list = listings.map(house => {
          return <li key={house.id}>{house.location}{house.zip}{house.address}{house.buy}{house.rent}{house.price}
          <div>
            <Link to={`/listings/${house.id}`}>show details</Link>
          </div>
          </li>
      })

    return (
        <div>
        <div id="nav-centering">
